INSERT INTO `cards` (`id`, `name`, `supertype`, `types`, `number`, `artist`, `rarity`, `flavorText`, `small`, `large`) VALUES
('rsv10pt5-1', 'Sewaddle', 'Pokémon', 'Grass', 1, 'Oswaldo KATO', 'Common', 'Leavanny dress it in clothes they made for it when it hatched. It hides its head in its hood while it is sleeping.', 'https://images.pokemontcg.io/rsv10pt5/1.png', 'https://images.pokemontcg.io/rsv10pt5/1_hires.png'),
('rsv10pt5-2', 'Swadloon', 'Pokémon', 'Grass', 2, 'Oswaldo KATO', 'Common', 'Forests where Swadloon live have superb foliage because the nutrients they make from fallen leaves nourish the plant life.', 'https://images.pokemontcg.io/rsv10pt5/2.png', 'https://images.pokemontcg.io/rsv10pt5/2_hires.png'),
('rsv10pt5-3', 'Leavanny', 'Pokémon', 'Grass', 3, 'Oswaldo KATO', 'Uncommon', 'Upon finding a small Pokémon, it weaves clothing for it from leaves, using the cutters on its arms and sticky silk.', 'https://images.pokemontcg.io/rsv10pt5/3.png', 'https://images.pokemontcg.io/rsv10pt5/3_hires.png'),
('rsv10pt5-4', 'Cottonee', 'Pokémon', 'Grass', 4, 'sui', 'Common', 'When attacked, it escapes by shooting cotton from its body. The cotton serves as a decoy to distract the attacker.', 'https://images.pokemontcg.io/rsv10pt5/4.png', 'https://images.pokemontcg.io/rsv10pt5/4_hires.png'),
('rsv10pt5-5', 'Whimsicott ex', 'Pokémon', 'Grass', 5, '5ban Graphics', 'Double Rare', '', 'https://images.pokemontcg.io/rsv10pt5/5.png', 'https://images.pokemontcg.io/rsv10pt5/5_hires.png'),
('rsv10pt5-6', 'Deerling', 'Pokémon', 'Grass', 6, 'Narano', 'Common', 'The color and scent of their fur changes to match the mountain grass. When they sense hostility, they hide in the grass.', 'https://images.pokemontcg.io/rsv10pt5/6.png', 'https://images.pokemontcg.io/rsv10pt5/6_hires.png'),
('rsv10pt5-7', 'Sawsbuck', 'Pokémon', 'Grass', 7, 'Narano', 'Uncommon', 'They migrate according to the seasons. People can tell the season by looking at Sawsbuck\'s horns.', 'https://images.pokemontcg.io/rsv10pt5/7.png', 'https://images.pokemontcg.io/rsv10pt5/7_hires.png'),
('rsv10pt5-8', 'Shelmet', 'Pokémon', 'Grass', 8, 'Saboteri', 'Common', 'When attacked, it defends itself by closing the lid of its shell. It can spit a sticky, poisonous liquid.', 'https://images.pokemontcg.io/rsv10pt5/8.png', 'https://images.pokemontcg.io/rsv10pt5/8_hires.png'),
('rsv10pt5-9', 'Accelgor', 'Pokémon', 'Grass', 9, 'Saboteri', 'Uncommon', 'When its body dries out, it weakens. So, to prevent dehydration, it wraps itself in many layers of thin membrane.', 'https://images.pokemontcg.io/rsv10pt5/9.png', 'https://images.pokemontcg.io/rsv10pt5/9_hires.png'),
('rsv10pt5-10', 'Virizion', 'Pokémon', 'Grass', 10, 'Felicia Chen', 'Rare', 'This Pokémon fought humans in order to protect its friends. Legends about it continue to be passed down.', 'https://images.pokemontcg.io/rsv10pt5/10.png', 'https://images.pokemontcg.io/rsv10pt5/10_hires.png'),
('rsv10pt5-11', 'Tepig', 'Pokémon', 'Fire', 11, 'Teeziro', 'Common', 'It can deftly dodge its foe\'s attacks while shooting fireballs from its nose. It roasts berries before it eats them.', 'https://images.pokemontcg.io/rsv10pt5/11.png', 'https://images.pokemontcg.io/rsv10pt5/11_hires.png'),
('rsv10pt5-12', 'Pignite', 'Pokémon', 'Fire', 12, 'Teeziro', 'Common', 'When its internal fire flares up, its movements grow sharper and faster. When in trouble, it emits smoke.', 'https://images.pokemontcg.io/rsv10pt5/12.png', 'https://images.pokemontcg.io/rsv10pt5/12_hires.png'),
('rsv10pt5-13', 'Emboar', 'Pokémon', 'Fire', 13, 'Teeziro', 'Rare', 'It can throw a fire punch by setting its fists on fire with its fiery chin. It cares deeply about its friends.', 'https://images.pokemontcg.io/rsv10pt5/13.png', 'https://images.pokemontcg.io/rsv10pt5/13_hires.png'),
('rsv10pt5-14', 'Pansear', 'Pokémon', 'Fire', 14, 'Julie Hang', 'Common', 'When it is angered, the temperature of its head tuft reaches 600° F. It uses its tuft to roast berries.', 'https://images.pokemontcg.io/rsv10pt5/14.png', 'https://images.pokemontcg.io/rsv10pt5/14_hires.png'),
('rsv10pt5-15', 'Simisear', 'Pokémon', 'Fire', 15, 'Julie Hang', 'Uncommon', 'It loves sweets because they become energy for the fire burning inside its body.', 'https://images.pokemontcg.io/rsv10pt5/15.png', 'https://images.pokemontcg.io/rsv10pt5/15_hires.png'),
('rsv10pt5-16', 'Litwick', 'Pokémon', 'Fire', 16, 'satoma', 'Common', 'Litwick shines a light that absorbs the life energy of people and Pokémon, which becomes the fuel that it burns.', 'https://images.pokemontcg.io/rsv10pt5/16.png', 'https://images.pokemontcg.io/rsv10pt5/16_hires.png'),
('rsv10pt5-17', 'Lampent', 'Pokémon', 'Fire', 17, 'satoma', 'Common', 'This ominous Pokémon is feared. Through cities it wanders, searching for the spirits of the fallen.', 'https://images.pokemontcg.io/rsv10pt5/17.png', 'https://images.pokemontcg.io/rsv10pt5/17_hires.png'),
('rsv10pt5-18', 'Chandelure', 'Pokémon', 'Fire', 18, 'satoma', 'Rare', 'It absorbs a spirit, which it then burns. By waving the flames on its arms, it puts its foes into a hypnotic trance.', 'https://images.pokemontcg.io/rsv10pt5/18.png', 'https://images.pokemontcg.io/rsv10pt5/18_hires.png'),
('rsv10pt5-19', 'Heatmor', 'Pokémon', 'Fire', 19, 'Minahamu', 'Uncommon', 'It breathes through a hole in its tail while it burns with an internal fire. Durant is its prey.', 'https://images.pokemontcg.io/rsv10pt5/19.png', 'https://images.pokemontcg.io/rsv10pt5/19_hires.png'),
('rsv10pt5-20', 'Reshiram ex', 'Pokémon', 'Fire', 20, '5ban Graphics', 'Double Rare', '', 'https://images.pokemontcg.io/rsv10pt5/20.png', 'https://images.pokemontcg.io/rsv10pt5/20_hires.png'),
('rsv10pt5-21', 'Oshawott', 'Pokémon', 'Water', 21, 'rika', 'Common', 'It fights using the scalchop on its stomach. In response to an attack, it retaliates immediately by slashing.', 'https://images.pokemontcg.io/rsv10pt5/21.png', 'https://images.pokemontcg.io/rsv10pt5/21_hires.png'),
('rsv10pt5-22', 'Dewott', 'Pokémon', 'Water', 22, 'rika', 'Common', 'Strict training is how it learns its flowing double-scalchop technique.', 'https://images.pokemontcg.io/rsv10pt5/22.png', 'https://images.pokemontcg.io/rsv10pt5/22_hires.png'),
('rsv10pt5-23', 'Samurott', 'Pokémon', 'Water', 23, 'rika', 'Rare', 'One swing of the sword incorporated in its armor can fell an opponent. A simple glare from one of them quiets everybody.', 'https://images.pokemontcg.io/rsv10pt5/23.png', 'https://images.pokemontcg.io/rsv10pt5/23_hires.png'),
('rsv10pt5-24', 'Basculin', 'Pokémon', 'Water', 24, 'KEIICHIRO ITO', 'Common', 'Red and blue Basculin get along so poorly, they\'ll start fighting instantly. These Pokémon are very hostile.', 'https://images.pokemontcg.io/rsv10pt5/24.png', 'https://images.pokemontcg.io/rsv10pt5/24_hires.png'),
('rsv10pt5-25', 'Ducklett', 'Pokémon', 'Water', 25, 'Mizue', 'Common', 'These bird Pokémon are excellent divers. They swim around in the water eating their favorite food--peat moss.', 'https://images.pokemontcg.io/rsv10pt5/25.png', 'https://images.pokemontcg.io/rsv10pt5/25_hires.png'),
('rsv10pt5-26', 'Swanna', 'Pokémon', 'Water', 26, 'Mizue', 'Uncommon', 'Swanna start to dance at dusk. The one dancing in the middle is the leader of the flock.', 'https://images.pokemontcg.io/rsv10pt5/26.png', 'https://images.pokemontcg.io/rsv10pt5/26_hires.png'),
('rsv10pt5-27', 'Vanillite', 'Pokémon', 'Water', 27, 'cochi8i', 'Common', 'The temperature of their breath is -58° F. They create snow crystals and make snow fall in the areas around them.', 'https://images.pokemontcg.io/rsv10pt5/27.png', 'https://images.pokemontcg.io/rsv10pt5/27_hires.png'),
('rsv10pt5-28', 'Vanillish', 'Pokémon', 'Water', 28, 'cochi8i', 'Common', 'Snowy mountains are this Pokémon\'s habitat. During an ancient ice age, they moved to southern areas.', 'https://images.pokemontcg.io/rsv10pt5/28.png', 'https://images.pokemontcg.io/rsv10pt5/28_hires.png'),
('rsv10pt5-29', 'Vanilluxe', 'Pokémon', 'Water', 29, 'cochi8i', 'Uncommon', 'Swallowing large amounts of water, they make snow clouds inside their bodies and attack their foes with violent blizzards.', 'https://images.pokemontcg.io/rsv10pt5/29.png', 'https://images.pokemontcg.io/rsv10pt5/29_hires.png'),
('rsv10pt5-30', 'Keldeo ex', 'Pokémon', 'Water', 30, 'PLANETA Yamashita', 'Double Rare', '', 'https://images.pokemontcg.io/rsv10pt5/30.png', 'https://images.pokemontcg.io/rsv10pt5/30_hires.png'),
('rsv10pt5-31', 'Blitzle', 'Pokémon', 'Lightning', 31, 'Mugi Hamada', 'Common', 'Its mane shines when it discharges electricity. They use their flashing manes to communicate with one another.', 'https://images.pokemontcg.io/rsv10pt5/31.png', 'https://images.pokemontcg.io/rsv10pt5/31_hires.png'),
('rsv10pt5-32', 'Zebstrika', 'Pokémon', 'Lightning', 32, 'Mugi Hamada', 'Uncommon', 'They have lightning-like movements. When Zebstrika run at full speed, the sound of thunder reverberates.', 'https://images.pokemontcg.io/rsv10pt5/32.png', 'https://images.pokemontcg.io/rsv10pt5/32_hires.png'),
('rsv10pt5-33', 'Joltik', 'Pokémon', 'Lightning', 33, 'Shimaris Yukichi', 'Common', 'Joltik that live in cities have learned a technique for sucking electricity from the outlets in houses.', 'https://images.pokemontcg.io/rsv10pt5/33.png', 'https://images.pokemontcg.io/rsv10pt5/33_hires.png'),
('rsv10pt5-34', 'Galvantula', 'Pokémon', 'Lightning', 34, 'Shimaris Yukichi', 'Uncommon', 'When attacked, they create an electric barrier by spitting out many electrically charged threads.', 'https://images.pokemontcg.io/rsv10pt5/34.png', 'https://images.pokemontcg.io/rsv10pt5/34_hires.png'),
('rsv10pt5-35', 'Stunfisk', 'Pokémon', 'Lightning', 35, 'Yuya Oka', 'Uncommon', 'Its skin is very hard, so it is unhurt even if stepped on by sumo wrestlers. It smiles when transmitting electricity.', 'https://images.pokemontcg.io/rsv10pt5/35.png', 'https://images.pokemontcg.io/rsv10pt5/35_hires.png'),
('rsv10pt5-36', 'Woobat', 'Pokémon', 'Psychic', 36, 'Wintr Wandr', 'Common', 'Its habitat is dark forests and caves. It emits ultrasonic waves from its nose to learn about its surroundings.', 'https://images.pokemontcg.io/rsv10pt5/36.png', 'https://images.pokemontcg.io/rsv10pt5/36_hires.png'),
('rsv10pt5-37', 'Swoobat', 'Pokémon', 'Psychic', 37, 'Wintr Wandr', 'Uncommon', 'It emits sound waves of various frequencies from its nose, including some powerful enough to destroy rocks.', 'https://images.pokemontcg.io/rsv10pt5/37.png', 'https://images.pokemontcg.io/rsv10pt5/37_hires.png'),
('rsv10pt5-38', 'Sigilyph', 'Pokémon', 'Psychic', 38, 'Krgc', 'Uncommon', 'They never vary the route they fly, because their memories of guarding an ancient city remain steadfast.', 'https://images.pokemontcg.io/rsv10pt5/38.png', 'https://images.pokemontcg.io/rsv10pt5/38_hires.png'),
('rsv10pt5-39', 'Yamask', 'Pokémon', 'Psychic', 39, 'Bun Toujo', 'Common', 'Each of them carries a mask that used to be its face when it was human. Sometimes they look at it and cry.', 'https://images.pokemontcg.io/rsv10pt5/39.png', 'https://images.pokemontcg.io/rsv10pt5/39_hires.png'),
('rsv10pt5-40', 'Cofagrigus', 'Pokémon', 'Psychic', 40, 'Bun Toujo', 'Rare', 'It has been said that they swallow those who get too close and turn them into mummies. They like to eat gold nuggets.', 'https://images.pokemontcg.io/rsv10pt5/40.png', 'https://images.pokemontcg.io/rsv10pt5/40_hires.png'),
('rsv10pt5-41', 'Gothita', 'Pokémon', 'Psychic', 41, 'Mousho', 'Common', 'Their ribbonlike feelers increase their psychic power. They are always staring at something.', 'https://images.pokemontcg.io/rsv10pt5/41.png', 'https://images.pokemontcg.io/rsv10pt5/41_hires.png'),
('rsv10pt5-42', 'Gothorita', 'Pokémon', 'Psychic', 42, 'Mousho', 'Common', 'They use hypnosis to control people and Pokémon. Tales of Gothorita leading people astray are told in every corner.', 'https://images.pokemontcg.io/rsv10pt5/42.png', 'https://images.pokemontcg.io/rsv10pt5/42_hires.png'),
('rsv10pt5-43', 'Gothitelle', 'Pokémon', 'Psychic', 43, 'Mousho', 'Rare', 'Starry skies thousands of light-years away are visible in the space distorted by their intense psychic power.', 'https://images.pokemontcg.io/rsv10pt5/43.png', 'https://images.pokemontcg.io/rsv10pt5/43_hires.png'),
('rsv10pt5-44', 'Frillish', 'Pokémon', 'Psychic', 44, 'MARINA Chikazawa', 'Common', 'With its thin, veil-like arms wrapped around the body of its opponent, it sinks to the ocean floor.', 'https://images.pokemontcg.io/rsv10pt5/44.png', 'https://images.pokemontcg.io/rsv10pt5/44_hires.png'),
('rsv10pt5-45', 'Jellicent ex', 'Pokémon', 'Psychic', 45, 'PLANETA Igarashi', 'Double Rare', '', 'https://images.pokemontcg.io/rsv10pt5/45.png', 'https://images.pokemontcg.io/rsv10pt5/45_hires.png'),
('rsv10pt5-46', 'Roggenrola', 'Pokémon', 'Fighting', 46, 'Anesaki Dynamic', 'Common', 'Its ear is hexagonal in shape. Compressed underground, its body is as hard as steel.', 'https://images.pokemontcg.io/rsv10pt5/46.png', 'https://images.pokemontcg.io/rsv10pt5/46_hires.png'),
('rsv10pt5-47', 'Boldore', 'Pokémon', 'Fighting', 47, 'Anesaki Dynamic', 'Common', 'When it overflows with power, the orange crystal on its body glows. It looks for underground water in caves.', 'https://images.pokemontcg.io/rsv10pt5/47.png', 'https://images.pokemontcg.io/rsv10pt5/47_hires.png'),
('rsv10pt5-48', 'Gigalith', 'Pokémon', 'Fighting', 48, 'Anesaki Dynamic', 'Uncommon', 'Compressing the energy from its internal core lets it fire off an attack capable of blowing away a mountain.', 'https://images.pokemontcg.io/rsv10pt5/48.png', 'https://images.pokemontcg.io/rsv10pt5/48_hires.png'),
('rsv10pt5-49', 'Sawk', 'Pokémon', 'Fighting', 49, 'Dsuke', 'Uncommon', 'The sound of Sawk punching boulders and trees can be heard all the way from the mountains where they train.', 'https://images.pokemontcg.io/rsv10pt5/49.png', 'https://images.pokemontcg.io/rsv10pt5/49_hires.png'),
('rsv10pt5-50', 'Archen', 'Pokémon', 'Fighting', 50, 'Haru Akasaka', 'Uncommon', 'Said to be an ancestor of bird Pokémon, they were unable to fly and moved about by hopping from one branch to another.', 'https://images.pokemontcg.io/rsv10pt5/50.png', 'https://images.pokemontcg.io/rsv10pt5/50_hires.png'),
('rsv10pt5-51', 'Archeops', 'Pokémon', 'Fighting', 51, 'Haru Akasaka', 'Rare', 'They are intelligent and will cooperate to catch prey. From the ground, they use a running start to take flight.', 'https://images.pokemontcg.io/rsv10pt5/51.png', 'https://images.pokemontcg.io/rsv10pt5/51_hires.png'),
('rsv10pt5-52', 'Mienfoo', 'Pokémon', 'Fighting', 52, 'Keisin', 'Common', 'In fights, they dominate with onslaughts of flowing, continuous attacks. With their sharp claws, they cut enemies.', 'https://images.pokemontcg.io/rsv10pt5/52.png', 'https://images.pokemontcg.io/rsv10pt5/52_hires.png'),
('rsv10pt5-53', 'Mienshao', 'Pokémon', 'Fighting', 53, 'Keisin', 'Uncommon', 'It wields the fur on its arms like a whip. Its arm attacks come with such rapidity that they cannot even be seen.', 'https://images.pokemontcg.io/rsv10pt5/53.png', 'https://images.pokemontcg.io/rsv10pt5/53_hires.png'),
('rsv10pt5-54', 'Terrakion', 'Pokémon', 'Fighting', 54, 'Tonji Matsuno', 'Rare', 'This Pokémon came to the defense of Pokémon that had lost their homes in a war among humans.', 'https://images.pokemontcg.io/rsv10pt5/54.png', 'https://images.pokemontcg.io/rsv10pt5/54_hires.png'),
('rsv10pt5-55', 'Purrloin', 'Pokémon', 'Darkness', 55, 'Yuu Nishida', 'Common', 'They steal from people for fun, but their victims can\'t help but forgive them. Their deceptively cute act is perfect.', 'https://images.pokemontcg.io/rsv10pt5/55.png', 'https://images.pokemontcg.io/rsv10pt5/55_hires.png'),
('rsv10pt5-56', 'Liepard', 'Pokémon', 'Darkness', 56, 'Yuu Nishida', 'Uncommon', 'These Pokémon vanish and appear unexpectedly. Many Trainers are drawn to their beautiful form and fur.', 'https://images.pokemontcg.io/rsv10pt5/56.png', 'https://images.pokemontcg.io/rsv10pt5/56_hires.png'),
('rsv10pt5-57', 'Scraggy', 'Pokémon', 'Darkness', 57, 'osare', 'Common', 'Its skin has a rubbery elasticity, so it can reduce damage by defensively pulling its skin up to its neck.', 'https://images.pokemontcg.io/rsv10pt5/57.png', 'https://images.pokemontcg.io/rsv10pt5/57_hires.png'),
('rsv10pt5-58', 'Scrafty', 'Pokémon', 'Darkness', 58, 'osare', 'Uncommon', 'Groups of them beat up anything that enters their territory. Each can spit acidic liquid from its mouth.', 'https://images.pokemontcg.io/rsv10pt5/58.png', 'https://images.pokemontcg.io/rsv10pt5/58_hires.png'),
('rsv10pt5-59', 'Trubbish', 'Pokémon', 'Darkness', 59, 'OKUBO', 'Common', 'Inhaling the gas they belch will make you sleep for a week. They prefer unsanitary places.', 'https://images.pokemontcg.io/rsv10pt5/59.png', 'https://images.pokemontcg.io/rsv10pt5/59_hires.png'),
('rsv10pt5-60', 'Garbodor', 'Pokémon', 'Darkness', 60, 'OKUBO', 'Uncommon', 'It clenches opponents with its left arm and finishes them off with foul-smelling poison gas belched from its mouth.', 'https://images.pokemontcg.io/rsv10pt5/60.png', 'https://images.pokemontcg.io/rsv10pt5/60_hires.png'),
('rsv10pt5-61', 'Zorua', 'Pokémon', 'Darkness', 61, 'akagi', 'Common', 'It changes into the forms of others to surprise them. Apparently, it often transforms into a silent child.', 'https://images.pokemontcg.io/rsv10pt5/61.png', 'https://images.pokemontcg.io/rsv10pt5/61_hires.png'),
('rsv10pt5-62', 'Zoroark', 'Pokémon', 'Darkness', 62, 'akagi', 'Rare', 'Bonds between these Pokémon are very strong. It protects the safety of its pack by tricking its opponents.', 'https://images.pokemontcg.io/rsv10pt5/62.png', 'https://images.pokemontcg.io/rsv10pt5/62_hires.png'),
('rsv10pt5-63', 'Vullaby', 'Pokémon', 'Darkness', 63, 'Pani Kobayashi', 'Common', 'Its wings are too tiny to allow it to fly. As the time approaches for it to evolve, it discards the bones it was wearing.', 'https://images.pokemontcg.io/rsv10pt5/63.png', 'https://images.pokemontcg.io/rsv10pt5/63_hires.png'),
('rsv10pt5-64', 'Mandibuzz', 'Pokémon', 'Darkness', 64, 'Pani Kobayashi', 'Uncommon', 'It makes a nest out of bones it finds. It grabs weakened prey in its talons and hauls it to its nest of bones.', 'https://images.pokemontcg.io/rsv10pt5/64.png', 'https://images.pokemontcg.io/rsv10pt5/64_hires.png'),
('rsv10pt5-65', 'Deino', 'Pokémon', 'Darkness', 65, 'kodama', 'Common', 'It tends to bite everything, and it is not a picky eater. Approaching it carelessly is dangerous.', 'https://images.pokemontcg.io/rsv10pt5/65.png', 'https://images.pokemontcg.io/rsv10pt5/65_hires.png'),
('rsv10pt5-66', 'Zweilous', 'Pokémon', 'Darkness', 66, 'kodama', 'Common', 'After it has eaten up all the food in its territory, it moves to another area. Its two heads do not get along.', 'https://images.pokemontcg.io/rsv10pt5/66.png', 'https://images.pokemontcg.io/rsv10pt5/66_hires.png'),
('rsv10pt5-67', 'Hydreigon ex', 'Pokémon', 'Darkness', 67, '5ban Graphics', 'Double Rare', '', 'https://images.pokemontcg.io/rsv10pt5/67.png', 'https://images.pokemontcg.io/rsv10pt5/67_hires.png'),
('rsv10pt5-68', 'Ferroseed', 'Pokémon', 'Metal', 68, 'Hasuno', 'Common', 'When threatened, it attacks by shooting a barrage of spikes, which gives it a chance to escape by rolling away.', 'https://images.pokemontcg.io/rsv10pt5/68.png', 'https://images.pokemontcg.io/rsv10pt5/68_hires.png'),
('rsv10pt5-69', 'Ferrothorn', 'Pokémon', 'Metal', 69, 'Hasuno', 'Uncommon', 'It fights by swinging around its three spiky feelers. A hit from these steel spikes can reduce a boulder to rubble.', 'https://images.pokemontcg.io/rsv10pt5/69.png', 'https://images.pokemontcg.io/rsv10pt5/69_hires.png'),
('rsv10pt5-70', 'Durant', 'Pokémon', 'Metal', 70, 'Yuka Morii', 'Uncommon', 'They attack in groups, covering themselves in steel armor to protect themselves from Heatmor.', 'https://images.pokemontcg.io/rsv10pt5/70.png', 'https://images.pokemontcg.io/rsv10pt5/70_hires.png'),
('rsv10pt5-71', 'Druddigon', 'Pokémon', 'Dragon', 71, 'Nurikabe', 'Uncommon', 'It warms its body by absorbing sunlight with its wings. When its body temperature falls, it can no longer move.', 'https://images.pokemontcg.io/rsv10pt5/71.png', 'https://images.pokemontcg.io/rsv10pt5/71_hires.png'),
('rsv10pt5-72', 'Patrat', 'Pokémon', 'Colorless', 72, 'Ounishi', 'Common', 'Using food stored in cheek pouches, they can keep watch for days. They use their tails to communicate with others.', 'https://images.pokemontcg.io/rsv10pt5/72.png', 'https://images.pokemontcg.io/rsv10pt5/72_hires.png'),
('rsv10pt5-73', 'Watchog', 'Pokémon', 'Colorless', 73, 'Ounishi', 'Uncommon', 'When they see an enemy, their tails stand high, and they spit the seeds of berries stored in their cheek pouches.', 'https://images.pokemontcg.io/rsv10pt5/73.png', 'https://images.pokemontcg.io/rsv10pt5/73_hires.png'),
('rsv10pt5-74', 'Lillipup', 'Pokémon', 'Colorless', 74, 'sowsow', 'Common', 'It faces strong opponents with great courage. But, when at a disadvantage in a fight, this intelligent Pokémon flees.', 'https://images.pokemontcg.io/rsv10pt5/74.png', 'https://images.pokemontcg.io/rsv10pt5/74_hires.png'),
('rsv10pt5-75', 'Herdier', 'Pokémon', 'Colorless', 75, 'sowsow', 'Common', 'It has black, cape-like fur that is very hard and decreases the amount of damage it receives.', 'https://images.pokemontcg.io/rsv10pt5/75.png', 'https://images.pokemontcg.io/rsv10pt5/75_hires.png'),
