('rsv10pt5-148', 'Ferroseed', 'Pokémon', 'Metal', 148, 'Nurikabe', 'Illustration Rare', 'When threatened, it attacks by shooting a barrage of spikes, which gives it a chance to escape by rolling away.', 'https://images.pokemontcg.io/rsv10pt5/148.png', 'https://images.pokemontcg.io/rsv10pt5/148_hires.png'),
('rsv10pt5-149', 'Ferrothorn', 'Pokémon', 'Metal', 149, 'Minahamu', 'Illustration Rare', 'It fights by swinging around its three spiky feelers. A hit from these steel spikes can reduce a boulder to rubble.', 'https://images.pokemontcg.io/rsv10pt5/149.png', 'https://images.pokemontcg.io/rsv10pt5/149_hires.png'),
('rsv10pt5-150', 'Durant', 'Pokémon', 'Metal', 150, 'Scav', 'Illustration Rare', 'They attack in groups, covering themselves in steel armor to protect themselves from Heatmor.', 'https://images.pokemontcg.io/rsv10pt5/150.png', 'https://images.pokemontcg.io/rsv10pt5/150_hires.png'),
('rsv10pt5-151', 'Druddigon', 'Pokémon', 'Dragon', 151, 'Kamome Shirahama', 'Illustration Rare', 'It warms its body by absorbing sunlight with its wings. When its body temperature falls, it can no longer move.', 'https://images.pokemontcg.io/rsv10pt5/151.png', 'https://images.pokemontcg.io/rsv10pt5/151_hires.png'),
('rsv10pt5-152', 'Patrat', 'Pokémon', 'Colorless', 152, 'Yukihiro Tada', 'Illustration Rare', 'Using food stored in cheek pouches, they can keep watch for days. They use their tails to communicate with others.', 'https://images.pokemontcg.io/rsv10pt5/152.png', 'https://images.pokemontcg.io/rsv10pt5/152_hires.png'),
('rsv10pt5-153', 'Watchog', 'Pokémon', 'Colorless', 153, 'Mousho', 'Illustration Rare', 'When they see an enemy, their tails stand high, and they spit the seeds of berries stored in their cheek pouches.', 'https://images.pokemontcg.io/rsv10pt5/153.png', 'https://images.pokemontcg.io/rsv10pt5/153_hires.png'),
('rsv10pt5-154', 'Lillipup', 'Pokémon', 'Colorless', 154, 'Narumi Sato', 'Illustration Rare', 'It faces strong opponents with great courage. But, when at a disadvantage in a fight, this intelligent Pokémon flees.', 'https://images.pokemontcg.io/rsv10pt5/154.png', 'https://images.pokemontcg.io/rsv10pt5/154_hires.png'),
('rsv10pt5-155', 'Herdier', 'Pokémon', 'Colorless', 155, 'Makura Tami', 'Illustration Rare', 'It has black, cape-like fur that is very hard and decreases the amount of damage it receives.', 'https://images.pokemontcg.io/rsv10pt5/155.png', 'https://images.pokemontcg.io/rsv10pt5/155_hires.png'),
('rsv10pt5-156', 'Stoutland', 'Pokémon', 'Colorless', 156, 'Eri Kamei', 'Illustration Rare', 'It rescues people stranded by blizzards in the mountains. Its shaggy fur shields it from the cold.', 'https://images.pokemontcg.io/rsv10pt5/156.png', 'https://images.pokemontcg.io/rsv10pt5/156_hires.png'),
('rsv10pt5-157', 'Whimsicott ex', 'Pokémon', 'Grass', 157, '5ban Graphics', 'Ultra Rare', '', 'https://images.pokemontcg.io/rsv10pt5/157.png', 'https://images.pokemontcg.io/rsv10pt5/157_hires.png'),
