('rsv10pt5-170', 'Bouffalant ex', 'Pokémon', 'Colorless', 170, 'Rianti Hidayat', 'Special Illustration Rare', '', 'https://images.pokemontcg.io/rsv10pt5/170.png', 'https://images.pokemontcg.io/rsv10pt5/170_hires.png'),
('rsv10pt5-171', 'Hilda', 'Trainer', '', 171, 'Naoki Saito', 'Special Illustration Rare', '', 'https://images.pokemontcg.io/rsv10pt5/171.png', 'https://images.pokemontcg.io/rsv10pt5/171_hires.png'),
('rsv10pt5-172', 'Victini', 'Pokémon', 'Fire', 172, '5ban Graphics', 'Rare', 'This Pokémon brings victory. It is said that Trainers with Victini always win, regardless of the type of encounter.', 'https://images.pokemontcg.io/rsv10pt5/172.png', 'https://images.pokemontcg.io/rsv10pt5/172_hires.png'),
('rsv10pt5-173', 'Reshiram ex', 'Pokémon', 'Fire', 173, '5ban Graphics', 'Black White Rare', '', 'https://images.pokemontcg.io/rsv10pt5/173.png', 'https://images.pokemontcg.io/rsv10pt5/173_hires.png'),
('zsv10pt5-1', 'Snivy', 'Pokémon', 'Grass', 1, 'Susumu Maeya', 'Common', 'It is very intelligent and calm. Being exposed to lots of sunlight makes its movements swifter.', 'https://images.pokemontcg.io/zsv10pt5/1.png', 'https://images.pokemontcg.io/zsv10pt5/1_hires.png'),
('zsv10pt5-2', 'Servine', 'Pokémon', 'Grass', 2, 'Susumu Maeya', 'Common', 'It moves along the ground as if sliding. Its swift movements befuddle its foes, and it then attacks with a vine whip.', 'https://images.pokemontcg.io/zsv10pt5/2.png', 'https://images.pokemontcg.io/zsv10pt5/2_hires.png'),
('zsv10pt5-3', 'Serperior ex', 'Pokémon', 'Grass', 3, 'PLANETA Igarashi', 'Double Rare', '', 'https://images.pokemontcg.io/zsv10pt5/3.png', 'https://images.pokemontcg.io/zsv10pt5/3_hires.png'),
('zsv10pt5-4', 'Pansage', 'Pokémon', 'Grass', 4, 'kurumitsu', 'Common', 'This Pokémon dwells deep in the forest. Eating a leaf from its head whisks weariness away as if by magic.', 'https://images.pokemontcg.io/zsv10pt5/4.png', 'https://images.pokemontcg.io/zsv10pt5/4_hires.png'),
('zsv10pt5-5', 'Simisage', 'Pokémon', 'Grass', 5, 'kurumitsu', 'Uncommon', 'Ill tempered, it fights by swinging its barbed tail around wildly. The leaf growing on its head is very bitter.', 'https://images.pokemontcg.io/zsv10pt5/5.png', 'https://images.pokemontcg.io/zsv10pt5/5_hires.png'),
('zsv10pt5-6', 'Petilil', 'Pokémon', 'Grass', 6, 'mele', 'Common', 'The leaves on its head are very bitter. Eating one of these leaves is known to refresh a tired body.', 'https://images.pokemontcg.io/zsv10pt5/6.png', 'https://images.pokemontcg.io/zsv10pt5/6_hires.png'),
('zsv10pt5-7', 'Lilligant', 'Pokémon', 'Grass', 7, 'mele', 'Uncommon', 'Even veteran Trainers face a challenge in getting its beautiful flower to bloom. This Pokémon is popular with celebrities.', 'https://images.pokemontcg.io/zsv10pt5/7.png', 'https://images.pokemontcg.io/zsv10pt5/7_hires.png');
INSERT INTO `cards` (`id`, `name`, `supertype`, `types`, `number`, `artist`, `rarity`, `flavorText`, `small`, `large`) VALUES
('zsv10pt5-8', 'Maractus', 'Pokémon', 'Grass', 8, 'mingo', 'Common', 'It uses an up-tempo song and dance to drive away the bird Pokémon that prey on its flower seeds.', 'https://images.pokemontcg.io/zsv10pt5/8.png', 'https://images.pokemontcg.io/zsv10pt5/8_hires.png'),
('zsv10pt5-9', 'Karrablast', 'Pokémon', 'Grass', 9, 'DOM', 'Common', 'These mysterious Pokémon evolve when they receive electrical stimulation while they are in the same place as Shelmet.', 'https://images.pokemontcg.io/zsv10pt5/9.png', 'https://images.pokemontcg.io/zsv10pt5/9_hires.png'),
('zsv10pt5-10', 'Foongus', 'Pokémon', 'Grass', 10, 'Kurata So', 'Common', 'It lures people in with its Poké Ball pattern, then releases poison spores. Why it resembles a Poké Ball is unknown.', 'https://images.pokemontcg.io/zsv10pt5/10.png', 'https://images.pokemontcg.io/zsv10pt5/10_hires.png'),
('zsv10pt5-11', 'Amoonguss', 'Pokémon', 'Grass', 11, 'Kurata So', 'Uncommon', 'It lures prey close by dancing and waving its arm caps, which resemble Poké Balls, in a swaying motion.', 'https://images.pokemontcg.io/zsv10pt5/11.png', 'https://images.pokemontcg.io/zsv10pt5/11_hires.png'),
('zsv10pt5-12', 'Victini', 'Pokémon', 'Fire', 12, 'Natsumi Yoshida', 'Rare', 'This Pokémon brings victory. It is said that Trainers with Victini always win, regardless of the type of encounter.', 'https://images.pokemontcg.io/zsv10pt5/12.png', 'https://images.pokemontcg.io/zsv10pt5/12_hires.png'),
('zsv10pt5-13', 'Darumaka', 'Pokémon', 'Fire', 13, 'svlt', 'Common', 'When its internal fire is burning, it cannot calm down and it runs around. When the fire diminishes, it falls asleep.', 'https://images.pokemontcg.io/zsv10pt5/13.png', 'https://images.pokemontcg.io/zsv10pt5/13_hires.png'),
('zsv10pt5-14', 'Darmanitan', 'Pokémon', 'Fire', 14, 'svlt', 'Uncommon', 'Its internal fire burns at 2,500° F, making enough power that it can destroy a dump truck with one punch.', 'https://images.pokemontcg.io/zsv10pt5/14.png', 'https://images.pokemontcg.io/zsv10pt5/14_hires.png'),
('zsv10pt5-15', 'Larvesta', 'Pokémon', 'Fire', 15, 'mashu', 'Common', 'This Pokémon was believed to have been born from the sun. When it evolves, its entire body is engulfed in flames.', 'https://images.pokemontcg.io/zsv10pt5/15.png', 'https://images.pokemontcg.io/zsv10pt5/15_hires.png'),
('zsv10pt5-16', 'Volcarona', 'Pokémon', 'Fire', 16, 'mashu', 'Rare', 'When volcanic ash darkened the atmosphere, it is said that Volcarona\'s fire provided a replacement for the sun.', 'https://images.pokemontcg.io/zsv10pt5/16.png', 'https://images.pokemontcg.io/zsv10pt5/16_hires.png'),
('zsv10pt5-17', 'Panpour', 'Pokémon', 'Water', 17, 'Makura Tami', 'Common', 'The water stored inside the tuft on its head is full of nutrients. Plants that receive its water grow large.', 'https://images.pokemontcg.io/zsv10pt5/17.png', 'https://images.pokemontcg.io/zsv10pt5/17_hires.png'),
('zsv10pt5-18', 'Simipour', 'Pokémon', 'Water', 18, 'Makura Tami', 'Uncommon', 'The tuft on its head holds water. When the level runs low, it replenishes the tuft by siphoning up water with its tail.', 'https://images.pokemontcg.io/zsv10pt5/18.png', 'https://images.pokemontcg.io/zsv10pt5/18_hires.png'),
('zsv10pt5-19', 'Tympole', 'Pokémon', 'Water', 19, 'Yukihiro Tada', 'Common', 'They warn others of danger by vibrating their cheeks to create a high-pitched sound.', 'https://images.pokemontcg.io/zsv10pt5/19.png', 'https://images.pokemontcg.io/zsv10pt5/19_hires.png'),
('zsv10pt5-20', 'Palpitoad', 'Pokémon', 'Water', 20, 'Yukihiro Tada', 'Common', 'When they vibrate the bumps on their heads, they can make waves in water or earthquake-like vibrations on land.', 'https://images.pokemontcg.io/zsv10pt5/20.png', 'https://images.pokemontcg.io/zsv10pt5/20_hires.png'),
('zsv10pt5-21', 'Seismitoad', 'Pokémon', 'Water', 21, 'Yukihiro Tada', 'Uncommon', 'They shoot paralyzing liquid from their head bumps. They use vibration to hurt their opponents.', 'https://images.pokemontcg.io/zsv10pt5/21.png', 'https://images.pokemontcg.io/zsv10pt5/21_hires.png'),
('zsv10pt5-22', 'Tirtouga', 'Pokémon', 'Water', 22, 'Gemi', 'Uncommon', 'Restored from a fossil, this Pokémon can dive to depths beyond half a mile.', 'https://images.pokemontcg.io/zsv10pt5/22.png', 'https://images.pokemontcg.io/zsv10pt5/22_hires.png'),
('zsv10pt5-23', 'Carracosta', 'Pokémon', 'Water', 23, 'Gemi', 'Rare', 'They can live both in the ocean and on land. A slap from one of them is enough to open a hole in the bottom of a tanker.', 'https://images.pokemontcg.io/zsv10pt5/23.png', 'https://images.pokemontcg.io/zsv10pt5/23_hires.png'),
('zsv10pt5-24', 'Alomomola', 'Pokémon', 'Water', 24, 'Tika Matsuno', 'Uncommon', 'The special membrane enveloping Alomomola has the ability to heal wounds.', 'https://images.pokemontcg.io/zsv10pt5/24.png', 'https://images.pokemontcg.io/zsv10pt5/24_hires.png'),
('zsv10pt5-25', 'Cubchoo', 'Pokémon', 'Water', 25, 'OOYAMA', 'Common', 'When it is not feeling well, its mucus gets watery and the power of its Ice-type moves decreases.', 'https://images.pokemontcg.io/zsv10pt5/25.png', 'https://images.pokemontcg.io/zsv10pt5/25_hires.png'),
('zsv10pt5-26', 'Beartic', 'Pokémon', 'Water', 26, 'OOYAMA', 'Rare', 'It can make its breath freeze at will. Very able in the water, it swims around in northern seas and catches prey.', 'https://images.pokemontcg.io/zsv10pt5/26.png', 'https://images.pokemontcg.io/zsv10pt5/26_hires.png'),
('zsv10pt5-27', 'Cryogonal', 'Pokémon', 'Water', 27, 'Kyoko Umemoto', 'Uncommon', 'When its body temperature goes up, it turns into steam and vanishes. When its temperature lowers, it returns to ice.', 'https://images.pokemontcg.io/zsv10pt5/27.png', 'https://images.pokemontcg.io/zsv10pt5/27_hires.png'),
('zsv10pt5-28', 'Kyurem ex', 'Pokémon', 'Water', 28, 'N-DESIGN Inc.', 'Double Rare', '', 'https://images.pokemontcg.io/zsv10pt5/28.png', 'https://images.pokemontcg.io/zsv10pt5/28_hires.png'),
('zsv10pt5-29', 'Emolga', 'Pokémon', 'Lightning', 29, 'Tomowaka', 'Common', 'The energy made in its cheeks\' electric pouches is stored inside its membrane and released while it is gliding.', 'https://images.pokemontcg.io/zsv10pt5/29.png', 'https://images.pokemontcg.io/zsv10pt5/29_hires.png'),
('zsv10pt5-30', 'Tynamo', 'Pokémon', 'Lightning', 30, 'Jerky', 'Common', 'While one alone doesn\'t have much power, a chain of many Tynamo can be as powerful as lightning.', 'https://images.pokemontcg.io/zsv10pt5/30.png', 'https://images.pokemontcg.io/zsv10pt5/30_hires.png'),
('zsv10pt5-31', 'Eelektrik', 'Pokémon', 'Lightning', 31, 'Jerky', 'Uncommon', 'They coil around foes and shock them with electricity-generating organs that seem simply to be circular patterns.', 'https://images.pokemontcg.io/zsv10pt5/31.png', 'https://images.pokemontcg.io/zsv10pt5/31_hires.png'),
('zsv10pt5-32', 'Eelektross', 'Pokémon', 'Lightning', 32, 'Jerky', 'Uncommon', 'They crawl out of the ocean using their arms. They will attack prey on shore and immediately drag it into the ocean.', 'https://images.pokemontcg.io/zsv10pt5/32.png', 'https://images.pokemontcg.io/zsv10pt5/32_hires.png'),
('zsv10pt5-33', 'Thundurus', 'Pokémon', 'Lightning', 33, 'hncl', 'Rare', 'Countless charred remains mar the landscape of places through which Thundurus has passed.', 'https://images.pokemontcg.io/zsv10pt5/33.png', 'https://images.pokemontcg.io/zsv10pt5/33_hires.png'),
('zsv10pt5-34', 'Zekrom ex', 'Pokémon', 'Lightning', 34, 'takuyoa', 'Double Rare', '', 'https://images.pokemontcg.io/zsv10pt5/34.png', 'https://images.pokemontcg.io/zsv10pt5/34_hires.png'),
('zsv10pt5-35', 'Munna', 'Pokémon', 'Psychic', 35, 'Eri Kamei', 'Common', 'Munna always float in the air. People whose dreams are eaten by them forget what the dreams had been about.', 'https://images.pokemontcg.io/zsv10pt5/35.png', 'https://images.pokemontcg.io/zsv10pt5/35_hires.png'),
('zsv10pt5-36', 'Musharna', 'Pokémon', 'Psychic', 36, 'Eri Kamei', 'Uncommon', 'The mist emanating from their foreheads is packed with the dreams of people and Pokémon.', 'https://images.pokemontcg.io/zsv10pt5/36.png', 'https://images.pokemontcg.io/zsv10pt5/36_hires.png'),
('zsv10pt5-37', 'Solosis', 'Pokémon', 'Psychic', 37, 'LINNE', 'Common', 'They drive away attackers by unleashing psychic power. They can use telepathy to talk with others.', 'https://images.pokemontcg.io/zsv10pt5/37.png', 'https://images.pokemontcg.io/zsv10pt5/37_hires.png'),
('zsv10pt5-38', 'Duosion', 'Pokémon', 'Psychic', 38, 'LINNE', 'Common', 'Since they have two divided brains, at times they suddenly try to take two different actions at once.', 'https://images.pokemontcg.io/zsv10pt5/38.png', 'https://images.pokemontcg.io/zsv10pt5/38_hires.png'),
('zsv10pt5-39', 'Reuniclus', 'Pokémon', 'Psychic', 39, 'LINNE', 'Uncommon', 'When Reuniclus shake hands, a network forms between their brains, increasing their psychic power.', 'https://images.pokemontcg.io/zsv10pt5/39.png', 'https://images.pokemontcg.io/zsv10pt5/39_hires.png'),
('zsv10pt5-40', 'Elgyem', 'Pokémon', 'Psychic', 40, 'Apios', 'Common', 'It uses its strong psychic power to squeeze its opponent\'s brain, causing unendurable headaches.', 'https://images.pokemontcg.io/zsv10pt5/40.png', 'https://images.pokemontcg.io/zsv10pt5/40_hires.png'),
('zsv10pt5-41', 'Beheeyem', 'Pokémon', 'Psychic', 41, 'Apios', 'Uncommon', 'It can manipulate an opponent\'s memory. Apparently, it communicates by flashing its three different-colored fingers.', 'https://images.pokemontcg.io/zsv10pt5/41.png', 'https://images.pokemontcg.io/zsv10pt5/41_hires.png'),
('zsv10pt5-42', 'Golett', 'Pokémon', 'Psychic', 42, 'Uta', 'Common', 'The energy that burns inside it enables it to move, but no one has yet been able to identify this energy.', 'https://images.pokemontcg.io/zsv10pt5/42.png', 'https://images.pokemontcg.io/zsv10pt5/42_hires.png'),
('zsv10pt5-43', 'Golurk', 'Pokémon', 'Psychic', 43, 'Uta', 'Uncommon', 'It flies across the sky at Mach speeds. Removing the seal on its chest makes its internal energy go out of control.', 'https://images.pokemontcg.io/zsv10pt5/43.png', 'https://images.pokemontcg.io/zsv10pt5/43_hires.png'),
('zsv10pt5-44', 'Meloetta ex', 'Pokémon', 'Psychic', 44, '5ban Graphics', 'Double Rare', '', 'https://images.pokemontcg.io/zsv10pt5/44.png', 'https://images.pokemontcg.io/zsv10pt5/44_hires.png'),
('zsv10pt5-45', 'Drilbur', 'Pokémon', 'Fighting', 45, 'OKACHEKE', 'Common', 'It can dig through the ground at a speed of 30 mph. It could give a car running aboveground a good race.', 'https://images.pokemontcg.io/zsv10pt5/45.png', 'https://images.pokemontcg.io/zsv10pt5/45_hires.png'),
('zsv10pt5-46', 'Excadrill ex', 'Pokémon', 'Fighting', 46, 'N-DESIGN Inc.', 'Double Rare', '', 'https://images.pokemontcg.io/zsv10pt5/46.png', 'https://images.pokemontcg.io/zsv10pt5/46_hires.png'),
('zsv10pt5-47', 'Timburr', 'Pokémon', 'Fighting', 47, 'Shinya Mizuno', 'Common', 'It fights by swinging a piece of lumber around. It is close to evolving when it can handle the lumber without difficulty.', 'https://images.pokemontcg.io/zsv10pt5/47.png', 'https://images.pokemontcg.io/zsv10pt5/47_hires.png'),
('zsv10pt5-48', 'Gurdurr', 'Pokémon', 'Fighting', 48, 'Shinya Mizuno', 'Common', 'This Pokémon is so muscular and strongly built that even a group of wrestlers could not make it budge an inch.', 'https://images.pokemontcg.io/zsv10pt5/48.png', 'https://images.pokemontcg.io/zsv10pt5/48_hires.png'),
('zsv10pt5-49', 'Conkeldurr', 'Pokémon', 'Fighting', 49, 'Shinya Mizuno', 'Rare', 'It is thought that Conkeldurr taught humans how to make concrete more than 2,000 years ago.', 'https://images.pokemontcg.io/zsv10pt5/49.png', 'https://images.pokemontcg.io/zsv10pt5/49_hires.png'),
('zsv10pt5-50', 'Throh', 'Pokémon', 'Fighting', 50, 'Shin Nagasawa', 'Uncommon', 'When it tightens its belt, it becomes stronger. Wild Throh use vines to weave their own belts.', 'https://images.pokemontcg.io/zsv10pt5/50.png', 'https://images.pokemontcg.io/zsv10pt5/50_hires.png'),
('zsv10pt5-51', 'Dwebble', 'Pokémon', 'Fighting', 51, 'Tetsu Kayama', 'Common', 'This Pokémon can easily melt holes in hard rocks with a liquid secreted from its mouth.', 'https://images.pokemontcg.io/zsv10pt5/51.png', 'https://images.pokemontcg.io/zsv10pt5/51_hires.png'),
('zsv10pt5-52', 'Crustle', 'Pokémon', 'Fighting', 52, 'Tetsu Kayama', 'Uncommon', 'Competing for territory, Crustle fight viciously. The one whose boulder is broken is the loser of the battle.', 'https://images.pokemontcg.io/zsv10pt5/52.png', 'https://images.pokemontcg.io/zsv10pt5/52_hires.png'),
