('zsv10pt5-125', 'Timburr', 'Pokémon', 'Fighting', 125, 'Shigenori Negishi', 'Illustration Rare', 'It fights by swinging a piece of lumber around. It is close to evolving when it can handle the lumber without difficulty.', 'https://images.pokemontcg.io/zsv10pt5/125.png', 'https://images.pokemontcg.io/zsv10pt5/125_hires.png'),
('zsv10pt5-126', 'Gurdurr', 'Pokémon', 'Fighting', 126, 'Souichirou Gunjima', 'Illustration Rare', 'This Pokémon is so muscular and strongly built that even a group of wrestlers could not make it budge an inch.', 'https://images.pokemontcg.io/zsv10pt5/126.png', 'https://images.pokemontcg.io/zsv10pt5/126_hires.png'),
('zsv10pt5-127', 'Conkeldurr', 'Pokémon', 'Fighting', 127, 'Kazumasa Yasukuni', 'Illustration Rare', 'It is thought that Conkeldurr taught humans how to make concrete more than 2,000 years ago.', 'https://images.pokemontcg.io/zsv10pt5/127.png', 'https://images.pokemontcg.io/zsv10pt5/127_hires.png'),
('zsv10pt5-128', 'Throh', 'Pokémon', 'Fighting', 128, 'GOSSAN', 'Illustration Rare', 'When it tightens its belt, it becomes stronger. Wild Throh use vines to weave their own belts.', 'https://images.pokemontcg.io/zsv10pt5/128.png', 'https://images.pokemontcg.io/zsv10pt5/128_hires.png'),
('zsv10pt5-129', 'Dwebble', 'Pokémon', 'Fighting', 129, 'Shimaris Yukichi', 'Illustration Rare', 'This Pokémon can easily melt holes in hard rocks with a liquid secreted from its mouth.', 'https://images.pokemontcg.io/zsv10pt5/129.png', 'https://images.pokemontcg.io/zsv10pt5/129_hires.png'),
('zsv10pt5-130', 'Crustle', 'Pokémon', 'Fighting', 130, 'MINAMINAMI Take', 'Illustration Rare', 'Competing for territory, Crustle fight viciously. The one whose boulder is broken is the loser of the battle.', 'https://images.pokemontcg.io/zsv10pt5/130.png', 'https://images.pokemontcg.io/zsv10pt5/130_hires.png'),
('zsv10pt5-131', 'Landorus', 'Pokémon', 'Fighting', 131, 'SIE NANAHARA', 'Illustration Rare', 'Lands visited by Landorus grant such bountiful crops that it has been hailed as “The Guardian of the Fields.”', 'https://images.pokemontcg.io/zsv10pt5/131.png', 'https://images.pokemontcg.io/zsv10pt5/131_hires.png'),
('zsv10pt5-132', 'Venipede', 'Pokémon', 'Darkness', 132, 'Apios', 'Illustration Rare', 'Its bite injects a potent poison, enough to paralyze large bird Pokémon that try to prey on it.', 'https://images.pokemontcg.io/zsv10pt5/132.png', 'https://images.pokemontcg.io/zsv10pt5/132_hires.png'),
('zsv10pt5-133', 'Whirlipede', 'Pokémon', 'Darkness', 133, 'kurumitsu', 'Illustration Rare', 'Protected by a hard shell, it spins its body like a wheel and crashes furiously into its enemies.', 'https://images.pokemontcg.io/zsv10pt5/133.png', 'https://images.pokemontcg.io/zsv10pt5/133_hires.png'),
('zsv10pt5-134', 'Scolipede', 'Pokémon', 'Darkness', 134, 'Oku', 'Illustration Rare', 'With quick movements, it chases down its foes, attacking relentlessly with its horns until it prevails.', 'https://images.pokemontcg.io/zsv10pt5/134.png', 'https://images.pokemontcg.io/zsv10pt5/134_hires.png'),
('zsv10pt5-135', 'Sandile', 'Pokémon', 'Darkness', 135, 'Fujimoto Gold', 'Illustration Rare', 'They live buried in the sands of the desert. The sun-warmed sands prevent their body temperature from dropping.', 'https://images.pokemontcg.io/zsv10pt5/135.png', 'https://images.pokemontcg.io/zsv10pt5/135_hires.png'),
('zsv10pt5-136', 'Krokorok', 'Pokémon', 'Darkness', 136, 'Tonji Matsuno', 'Illustration Rare', 'They live in groups of a few individuals. Protective membranes shield their eyes from sandstorms.', 'https://images.pokemontcg.io/zsv10pt5/136.png', 'https://images.pokemontcg.io/zsv10pt5/136_hires.png'),
('zsv10pt5-137', 'Krookodile', 'Pokémon', 'Darkness', 137, 'Uninori', 'Illustration Rare', 'They never allow prey to escape. Their jaws are so powerful, they can crush the body of an automobile.', 'https://images.pokemontcg.io/zsv10pt5/137.png', 'https://images.pokemontcg.io/zsv10pt5/137_hires.png'),
('zsv10pt5-138', 'Escavalier', 'Pokémon', 'Metal', 138, 'Uta', 'Illustration Rare', 'They fly around at high speed, striking with their pointed spears. Even when in trouble, they face opponents bravely.', 'https://images.pokemontcg.io/zsv10pt5/138.png', 'https://images.pokemontcg.io/zsv10pt5/138_hires.png'),
('zsv10pt5-139', 'Klink', 'Pokémon', 'Metal', 139, 'Nobuhiro Imagawa', 'Illustration Rare', 'The two minigears that mesh together are predetermined. Each will rebound from other minigears without meshing.', 'https://images.pokemontcg.io/zsv10pt5/139.png', 'https://images.pokemontcg.io/zsv10pt5/139_hires.png'),
('zsv10pt5-140', 'Klang', 'Pokémon', 'Metal', 140, 'okayamatakatoshi', 'Illustration Rare', 'By changing the direction in which it rotates, it communicates its feelings to others. When angry, it rotates faster.', 'https://images.pokemontcg.io/zsv10pt5/140.png', 'https://images.pokemontcg.io/zsv10pt5/140_hires.png'),
('zsv10pt5-141', 'Klinklang', 'Pokémon', 'Metal', 141, 'Yuka Morii', 'Illustration Rare', 'Its red core functions as an energy tank. It fires the charged energy through its spikes into an area.', 'https://images.pokemontcg.io/zsv10pt5/141.png', 'https://images.pokemontcg.io/zsv10pt5/141_hires.png'),
('zsv10pt5-142', 'Pawniard', 'Pokémon', 'Metal', 142, 'Dsuke', 'Illustration Rare', 'Blades comprise this Pokémon\'s entire body. If battling dulls the blades, it sharpens them on stones by the river.', 'https://images.pokemontcg.io/zsv10pt5/142.png', 'https://images.pokemontcg.io/zsv10pt5/142_hires.png'),
('zsv10pt5-143', 'Bisharp', 'Pokémon', 'Metal', 143, 'toriyufu', 'Illustration Rare', 'It leads a group of Pawniard. It battles to become the boss, but will be driven from the group if it loses.', 'https://images.pokemontcg.io/zsv10pt5/143.png', 'https://images.pokemontcg.io/zsv10pt5/143_hires.png'),
('zsv10pt5-144', 'Cobalion', 'Pokémon', 'Metal', 144, 'hncl', 'Illustration Rare', 'This legendary Pokémon battled against humans to protect Pokémon. Its personality is calm and composed.', 'https://images.pokemontcg.io/zsv10pt5/144.png', 'https://images.pokemontcg.io/zsv10pt5/144_hires.png'),
('zsv10pt5-145', 'Axew', 'Pokémon', 'Dragon', 145, 'Ayako Ozaki', 'Illustration Rare', 'They use their tusks to crush the berries they eat. Repeated regrowth makes their tusks strong and sharp.', 'https://images.pokemontcg.io/zsv10pt5/145.png', 'https://images.pokemontcg.io/zsv10pt5/145_hires.png'),
('zsv10pt5-146', 'Fraxure', 'Pokémon', 'Dragon', 146, 'Yuya Oka', 'Illustration Rare', 'Since a broken tusk will not grow back, they diligently sharpen their tusks on river rocks after they\'ve been fighting.', 'https://images.pokemontcg.io/zsv10pt5/146.png', 'https://images.pokemontcg.io/zsv10pt5/146_hires.png'),
('zsv10pt5-147', 'Haxorus', 'Pokémon', 'Dragon', 147, 'akagi', 'Illustration Rare', 'They are kind but can be relentless when defending territory. They challenge foes with tusks that can cut steel.', 'https://images.pokemontcg.io/zsv10pt5/147.png', 'https://images.pokemontcg.io/zsv10pt5/147_hires.png'),
('zsv10pt5-148', 'Pidove', 'Pokémon', 'Colorless', 148, 'Mori Yuu', 'Illustration Rare', 'Each follows its Trainer\'s orders as best it can, but they sometimes fail to understand complicated commands.', 'https://images.pokemontcg.io/zsv10pt5/148.png', 'https://images.pokemontcg.io/zsv10pt5/148_hires.png'),
('zsv10pt5-149', 'Tranquill', 'Pokémon', 'Colorless', 149, 'cochi8i', 'Illustration Rare', 'It can return to its Trainer\'s location regardless of the distance separating them.', 'https://images.pokemontcg.io/zsv10pt5/149.png', 'https://images.pokemontcg.io/zsv10pt5/149_hires.png'),
('zsv10pt5-150', 'Unfezant', 'Pokémon', 'Colorless', 150, 'Yoshioka', 'Illustration Rare', 'Males swing their head plumage to threaten opponents. The females\' flying abilities surpass those of the males.', 'https://images.pokemontcg.io/zsv10pt5/150.png', 'https://images.pokemontcg.io/zsv10pt5/150_hires.png'),
('zsv10pt5-151', 'Audino', 'Pokémon', 'Colorless', 151, 'Asako Ito', 'Illustration Rare', 'It touches others with the feelers on its ears, using the sound of their heartbeats to tell how they are feeling.', 'https://images.pokemontcg.io/zsv10pt5/151.png', 'https://images.pokemontcg.io/zsv10pt5/151_hires.png'),
('zsv10pt5-152', 'Minccino', 'Pokémon', 'Colorless', 152, 'Natsumi Yoshida', 'Illustration Rare', 'They greet one another by rubbing each other with their tails, which are always kept well groomed and clean.', 'https://images.pokemontcg.io/zsv10pt5/152.png', 'https://images.pokemontcg.io/zsv10pt5/152_hires.png'),
('zsv10pt5-153', 'Cinccino', 'Pokémon', 'Colorless', 153, 'tono', 'Illustration Rare', 'Their white fur is coated in a special oil that makes it easy for them to deflect attacks.', 'https://images.pokemontcg.io/zsv10pt5/153.png', 'https://images.pokemontcg.io/zsv10pt5/153_hires.png'),
('zsv10pt5-154', 'Rufflet', 'Pokémon', 'Colorless', 154, 'Miki Tanaka', 'Illustration Rare', 'They crush berries with their talons. They bravely stand up to any opponent, no matter how strong it is.', 'https://images.pokemontcg.io/zsv10pt5/154.png', 'https://images.pokemontcg.io/zsv10pt5/154_hires.png'),
('zsv10pt5-155', 'Braviary', 'Pokémon', 'Colorless', 155, 'kamonabe', 'Illustration Rare', 'They fight for their friends without any thought about danger to themselves. One can carry a car while flying.', 'https://images.pokemontcg.io/zsv10pt5/155.png', 'https://images.pokemontcg.io/zsv10pt5/155_hires.png'),
